  <text font-family="Arial" font-size="11.25pt" fill="#a6a6a6">
<tspan x="17.9991341" y="14.5856647" textLength="179.25">A card has battle stats like:</tspan>
<tspan x="53.9991341" y="32.5856628" textLength="30.875">Cost</tspan>
<tspan x="53.9991341" y="50.5856628" textLength="78.375">Attack point</tspan>
<tspan x="53.9991341" y="68.58566" textLength="80.25">Health point</tspan>
<tspan x="53.9991341" y="86.58566" textLength="41">Spells</tspan>
<tspan x="53.9991341" y="104.585663" textLength="55.125">Triggers</tspan>
<tspan x="36" y="122.585663" textLength="326.25">These are fixed once we know “what” the card is.</tspan>
<tspan x="362.25" y="122.585663" textLength="4.125"> </tspan>
<tspan x="17.9991341" y="140.585663" textLength="795.875">Given “what” the card is, there is still a random cosmetic property for each one of the kind, determining the visual effects</tspan>
<tspan x="813.874146" y="140.585663" textLength="4.125"> </tspan>
<tspan x="17.9991341" y="158.585663" textLength="109.375">within the game.</tspan>
<tspan x="17.9991341" y="194.585663" textLength="202.75">Official “Rarity” isn’t the whole:</tspan>
<tspan x="53.9991341" y="212.585663" textLength="573.125">Besides tiers, cosmetic properties will also affect the rarity, thus affect collection value.</tspan>
<tspan x="53.9991341" y="230.585663" textLength="723.5">Play style and deck environment also affect the price on card market. So a wise commander seeing the trend</tspan>
<tspan x="777.499146" y="230.585663" textLength="4.125"> </tspan>
<tspan x="53.9991341" y="248.585663" textLength="89.25">knows better.</tspan>
</text>

  <text font-family="Arial" font-size="11.25pt" fill="#a6a6a6">
<tspan x="17.9991341" y="14.5856647" textLength="272.875">Player form decks within the game client.</tspan>
<tspan x="17.9991341" y="50.5856628" textLength="532.25">To form interesting decks, players tend to pursue more and more kinds of cards.</tspan>
<tspan x="17.9991341" y="86.58566" textLength="222.75">Due to the limited amount of TRC</tspan>
<tspan x="240.74913" y="86.58566" textLength="323.625">721 token, one can’t just “copy” a deck of others.</tspan>
<tspan x="564.374146" y="86.58566" textLength="4.125"> </tspan>
<tspan x="53.9991341" y="104.585663" textLength="732.25">Because some cards others own are just too hard to get by everyone. One must think of a way of use effective</tspan>
<tspan x="786.249146" y="104.585663" textLength="4.125"> </tspan>
<tspan x="53.9991341" y="122.585663" textLength="81">alternatives.</tspan>
<tspan x="53.9991341" y="140.585663" textLength="657.375">Thus, there are more strategy fun than the non-blockchain TCG games. For example, Hearthstone.</tspan>
</text>
